function TodoList(props) {

    const [todos, onTodoClick] = props;

    return (
        <div>
            <ul>
                {todos.map(todo => (
                    <li key={todo.id}>{todo.title}</li>
                ))}
            </ul>
        </div>
    );
}

export default TodoList;
